import logo from './logo.svg';
import './App.css';

function RenderingArrayOfObjects() {
  const data = [
      {
          "State": "Uttar Pradesh",
          "Capital": "Lucknow"
      },
      {
          "State": "Gujarat",
          "Capital": "Gandhinagar"
      },
      {
          "State": "Karnataka",
          "Capital": "Bengaluru"
      },
      {
          "State": "Punjab",
          "Capital": "Chandigarh"
      },
      {
          "State": "Maharashtra",
          "Capital": "Mumbai"
      }
  ]
  const listItems = data.map(
      (element) => {
          return (
              <ul type="disc">
                  <li style={{ 
                      fontWeight: 'bold', 
                      color: 'red' }}
                  >
                      {element.State}
                  </li>
                  <li>{element.Capital}</li>
              </ul>
          )
      }
  )
  return (
      <div>
          {listItems}
      </div>
  )
}
function App() {
  return (
      <div className="App">
          <div>
              <h1 style={{ color: 'green' }}>
                  GeeksforGeeks
              </h1>
              <h3>Rendering Array of Objects</h3>
              <br></br>
              <RenderingArrayOfObjects />
          </div>
      </div>
  );
}



export default App;
